//Styles
import "./Portfolio.css";
const Portfolio = () => {
	return (
		<div className='portfolio-container'>
			<img></img>
			<h1>Title Of the Project</h1>
			<p>Information about the project</p>
		</div>
	);
};

export default Portfolio;
